import React from 'react'

const LessonCard = ({ image, title, vocabulary, grammar}) => {
  return (
    <div>
        <img src={image} alt='' />
        <h2>{title}</h2>
        <p>{vocabulary}</p>
        <p>{grammar}</p>
    </div>
  )
}

export default LessonCard
